// DOM Elements
const uploadTab = document.getElementById("uploadTab");
const recordTab = document.getElementById("recordTab");
const uploadSection = document.getElementById("uploadSection");
const recordSection = document.getElementById("recordSection");
const resultsSection = document.getElementById("resultsSection");
const loadingOverlay = document.getElementById("loadingOverlay");
const recordBtn = document.getElementById("recordBtn");
const recordingStatus = document.getElementById("recordingStatus");
const timerBar = document.getElementById("timerBar");
const audioFile = document.getElementById("audioFile");
const fileName = document.getElementById("fileName");
const emotionResult = document.getElementById("emotionResult");
const videoRecommendations = document.getElementById("videoRecommendations");
const backButton = document.getElementById("backButton");
const recordingWaves = document.querySelector(".recording-waves");

// Tab switching
uploadTab.addEventListener("click", () => {
  switchTab("upload");
});

recordTab.addEventListener("click", () => {
  switchTab("record");
});

function switchTab(tab) {
  if (tab === "upload") {
    uploadTab.classList.add("active");
    recordTab.classList.remove("active");
    uploadSection.classList.add("active");
    recordSection.classList.remove("active");
    resultsSection.classList.remove("active");
  } else {
    uploadTab.classList.remove("active");
    recordTab.classList.add("active");
    uploadSection.classList.remove("active");
    recordSection.classList.add("active");
    resultsSection.classList.remove("active");
  }
}

// File upload handling
audioFile.addEventListener("change", () => {
  if (audioFile.files.length > 0) {
    fileName.textContent = audioFile.files[0].name;
  } else {
    fileName.textContent = "";
  }
});

// Upload audio function
async function uploadAudio() {
  const file = audioFile.files[0];

  if (!file) {
    alert("Please select an audio file.");
    return;
  }

  showLoading();

  const formData = new FormData();
  formData.append("audio", file);

  try {
    const response = await fetch("/upload", {
      method: "POST",
      body: formData,
    });

    if (!response.ok) {
      throw new Error(`Error: ${response.statusText}`);
    }

    const data = await response.json();
    processEmotionResult(data.emotion);
  } catch (error) {
    console.error("Upload error:", error);
    hideLoading();
    alert("Failed to upload audio. Check console for details.");
  }
}

// Record audio functionality
recordBtn.addEventListener("click", async () => {
  if (!mediaRecorder || mediaRecorder.state === "inactive") {
    try {
      // Request microphone access
      const stream = await navigator.mediaDevices.getUserMedia({ audio: true });

      // Use WebM/Opus as the recording format
      mediaRecorder = new MediaRecorder(stream, { mimeType: "audio/webm" });

      recordedChunks = []; // Reset recorded data

      mediaRecorder.start();
      startRecordingUI();

      mediaRecorder.ondataavailable = (event) => {
        if (event.data.size > 0) {
          recordedChunks.push(event.data);
        }
      };

      mediaRecorder.onstop = async () => {
        stopRecordingUI();

        // Create a Blob from recorded audio
        const audioBlob = new Blob(recordedChunks, { type: "audio/webm" });
        const file = new File([audioBlob], "recorded_audio.webm", {
          type: "audio/webm",
        });

        // Send the audio file to the backend
        showLoading();

        const formData = new FormData();
        formData.append("audio", file);

        try {
          const response = await fetch("/upload", {
            method: "POST",
            body: formData,
          });

          if (!response.ok) {
            throw new Error(`Error: ${response.statusText}`);
          }

          const data = await response.json();
          processEmotionResult(data.emotion);
        } catch (error) {
          console.error("Upload error:", error);
          hideLoading();
          alert("Failed to upload recorded audio.");
        }
      };

      // Stop recording automatically after 5 seconds
      recordingTimer = setTimeout(() => {
        if (mediaRecorder && mediaRecorder.state === "recording") {
          mediaRecorder.stop();
        }
      }, 5000);
    } catch (error) {
      console.error("Error accessing microphone:", error);
      alert("Could not access your microphone. Please check permissions.");
    }
  } else if (mediaRecorder.state === "recording") {
    // Stop recording if already recording
    clearTimeout(recordingTimer);
    mediaRecorder.stop();
  }
});

// UI functions for recording
function startRecordingUI() {
  recordBtn.innerHTML = '<i class="fas fa-stop"></i> Stop Recording';
  recordBtn.classList.add("recording");
  recordingStatus.textContent = "üéôÔ∏è Recording in progress...";
  recordingWaves.classList.add("active");

  // Start timer animation
  let progress = 0;
  timerBar.style.width = "0%";

  timerInterval = setInterval(() => {
    progress += 2; // 2% every 100ms = 100% in 5 seconds
    timerBar.style.width = `${progress}%`;

    if (progress >= 100) {
      clearInterval(timerInterval);
    }
  }, 100);
}

function stopRecordingUI() {
  recordBtn.innerHTML = '<i class="fas fa-microphone"></i> Start Recording';
  recordBtn.classList.remove("recording");
  recordingStatus.textContent = "‚èπÔ∏è Recording complete";
  recordingWaves.classList.remove("active");
  clearInterval(timerInterval);
  timerBar.style.width = "100%";
}

// Loading overlay functions
function showLoading() {
  loadingOverlay.classList.add("active");
}

function hideLoading() {
  loadingOverlay.classList.remove("active");
}

// Process emotion result
